import React from 'react';

const Resume = () => {
  return (
    <section id="resume" className="py-20 px-6 text-center bg-black text-white">
      <h2 className="text-4xl font-serif text-primary mb-6">Resume</h2>
      <p className="mb-4">You can download my resume below:</p>
      <a 
        href="https://drive.google.com/file/d/13RvyGJMXEFkGIwBAbPm9ZPXAWXFUr01n/view?usp=sharing" 
        target="_blank" 
        rel="noopener noreferrer"
        className="px-6 py-3 bg-primary text-white rounded-lg hover:bg-hoverColor transition duration-300"
      >
        Download Resume
      </a>
    </section>
  );
};

export default Resume;
